import React, { useState } from 'react';
import './App.css';
import logo from './logo.svg'; 

function App() {
  const [numDigits, setNumDigits] = useState(5);

  return (
    <div className="App">
      <h1>Memory Game</h1>
      <p>{numDigits}</p>
    </div>
  );
}

export default App;
